import React from 'react'




const CollectionPreview = ({title,items }) => {
  console.log(items)
  return (
    <div>
      <h1>{title}</h1>
      <div className="preview">
        {
          items.map(item => {
            return(
              item.items.map((singleItem,index) => {
                if(index <=5){
                  return(
                    <div key={singleItem.id}>
                    {singleItem.name}
                  </div>
                  )
                }
              })
            )
          })
        }
      </div>
    </div>
  )
}

export default CollectionPreview;
